import React from "react";
import Stack from "@mui/material/Stack";
import Box from "@mui/material/Box";
import LockIcon from "@mui/icons-material/Lock";
import FormGroup from '@mui/material/FormGroup';
import FormControlLabel from '@mui/material/FormControlLabel';
import Checkbox from '@mui/material/Checkbox';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';

function SignUp(props) {
  return (
    <Stack justifyContent='center' alignItems="center" sx={{height:"100vh",border:"1px solid "}} spacing={4} >
      <Box>
        <Box>
          <LockIcon />
        </Box>
      </Box>
      <Box width="20%">
        <TextField sx={{width:"47%"}} label="Outlined secondary" color="secondary" focused />
        <TextField sx={{marginLeft:"18px",width:"47%"}} label="Outlined secondary" color="secondary" focused />
      </Box>
      <Box width="20%">
        <TextField sx={{width:"100%"}} label="Outlined secondary" color="secondary" focused />
      </Box>
      <Box width="20%">
        <FormControlLabel control={<Checkbox defaultChecked />} label="I want to recieve inspiration and marketing promotion and updates from" />
      </Box>
      <Button variant="contained">Contained</Button>
    </Stack>
  );
}

export default SignUp;
